import ClockComponent from "./Clock";

function PersonCard({ person }) {
  if (!person.name) {
    return <h2>loading...</h2>;
  }

  return (
    <div>
      <ClockComponent />
      <h1>{person.name}</h1>
      <h2>
        {person.name}'s total is {person.total}
      </h2>
      <h2>
        {person.name}'s balance is:{person.balance}
      </h2>
    </div>
  );
}

export default PersonCard;
